import { useCookies } from "react-cookie";

export default function GetCookies(values){
  const [cookies, setCookies] = useCookies();
  useEffect(()=>{},[cookies])


  if(Object.entries(cookies).length === 0){

      setCookies({
        "name": "user",
        "value": {},
        "option": {path: '/'}
      });
  
  }
    

  return cookies;
}
